import React from "react";
import ShowCard from "./ShowCard";

const ShowGrid = ({ data }) => {
  return (
    <>
      {data.map((item) => {
        return (
          <div>
            console.log(item);
            <ShowCard key={item.id} />
          </div>
        );
      })}
    </>
  );
};

export default ShowGrid;
